import React from 'react'

export default function ConfirmationMessage(props) {
    const type = props.type;

    // TODO: fill in message content with props.message
    const returnTypeMessage = () => {
        switch (type){
            case 'success':
                return (<div class="alert-box success">props</div>);
            case 'failure':
                return (<div class="alert-box failure">Failure Alert !!!</div>);
            case 'warning':
                return (<div class="alert-box warning">Warning Alert !!!</div>);
        }
    }
    return (
        <div>
            {returnTypeMessage}
        </div>
    )
}
